import React, { Component } from 'react'
//import * as ReactBS from 'react-bootstrap'

export default class ServicesCards extends React.Component {
  render() {
    const data = [
      {
        url: 'http://vkovalov.me/wp-json/wp/v2/services'
      }
    ];
    const services = data.map((service, index) => {
      return (
        <li>{service.title.rendered}</li>
      )
    });

    console.log(services);

    return (
      <div>
        {services}
      </div>
    )
  }
}
